import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { FaArrowLeft, FaHome } from 'react-icons/fa';
import './Login.css';
export default function Login() {
  return (
    <div className="flex h-screen">
      {/* Left side: solid blue background */}
      <div className="w-1/2 bg-blue-600"></div>

      {/* Right side: Google Login */}
      <div className="w-1/2 flex justify-center items-center">
        <div className="w-80">
          <h1 className="text-2xl font-bold mb-6 text-center">เข้าสู่ระบบ</h1>
          <p className="text-center mb-6 text-gray-600">
            ลงชื่อเข้าใช้ด้วยบัญชี Google
          </p>

          {/* Google Sign In Button */}
          <button className="w-full border border-gray-300 rounded-md p-3 flex items-center justify-center gap-2 hover:bg-gray-100">
            <span className="text-gray-700 font-medium">
              เข้าสู่ระบบด้วยบัญชี Google
            </span>
          </button>

          {/* Register link */}
          <p className="text-center mt-6 text-sm text-gray-600">
            ยังไม่มีบัญชีผู้ใช้?{" "}
            <a href="#" className="text-blue-600 hover:underline">
              ลงทะเบียน
            </a>
          </p>
        </div>
      </div>
    </div>
  );
}
